import { Marker, Popup } from 'react-leaflet';

// Inside MapView component
const getColor = (level) => {
    switch (level) {
        case 'High':
            return 'red';
        case 'Moderate':
            return 'orange';
        default:
            return 'green';
    }
};

// Inside return statement
{trafficData.map((data, index) => (
    <Marker
        key={index}
        position={[51.505 + index * 0.01, -0.09]}
        icon={new L.Icon({ iconUrl: `marker-${getColor(data.congestionLevel)}.png` })}
    >
        <Popup>
            {data.location}<br />Congestion Level: {data.congestionLevel}
        </Popup>
    </Marker>
))}
